import React from 'react';
import styles from './styles.module.css';
import Slider from '../../Components/Slider';
import stockicon from './stock-icon.svg';
import techicon from './tech-icon.svg';
import bankicon from './bank-icon.svg';
import History from './History.svg';

const getIconPath = (category) => {
    switch (category) {
        case 'Banking':
            return bankicon;
        case 'Technology':
            return techicon;
        case 'Stocks':
            return stockicon;
        default:
            return 'default-icon';
    }
};

const StockHistory = ({ filteredData }) => {
    return (
        <div className="shsearch-container">
            <div className="sRecent">
                <img src={History} alt="Recommended" className="sRecent-icon" />
                <div className="sRecent-title">Recently Viewed</div>
            </div>
            <ul className="shsearch-results scrollbar">
                {filteredData.map((item) => (
                    <li key={item.symbol} className="shsearch-item">
                        <img
                            src={getIconPath(item.category)}
                            alt={`${item.name} icon`}
                            className="shicon"
                        />
                        <div className="shitem-info">
                            <div className="shsymbol">{item.symbol}</div>
                            <div className="shname">{item.name}</div>
                        </div>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default StockHistory;
